import React from "react";
import MainHeader from "./mainHeader";
import Cards from "./cards";

interface MainProps {
  IDs: number[];
}

function Main(props: MainProps) {
  return (
    <div className="main">
      <MainHeader num={props.IDs.length} />
      <Cards IDs={props.IDs} page={props.page} />
    </div>
  );
}

export default Main;
